import React from "react";
const Movie = ({movie}) => {
  return (
    <div className="bod">
      <h5>{movie.title}</h5>
      <img className="new_movie" src={"https://image.tmdb.org/t/p/w500" + movie.backdrop_path} alt={movie.path} />
    </div>
  );
};
export default Movie;
